window.bookSummaryJSON = "<p><b>Blu</b></p> <p>There's a beast inside me, urging me to kill.</p> <p>As a psychiatrist, I expect to encounter psycho- and sociopathic patients. I never have the urge to kill them. Until one patient triggers a need inside me. I expect the kill to be easy, just like the others. What I don't expect is to want to possess my patient's boyfriend, June. As soon as I lay eyes on June, I know he's mine. He'll find out soon enough.</p> <p><b>June</b></p> <p>Wanting to be happy shouldn't cost me my life.</p> <p>I'm happy with my boyfriend and I'm ready to take our relationship to the next level. Until I find out he's a serial killer and I'm slated to be his next victim. I'm saved by a handsome older man just in the nick of timeâ€¦ the same handsome man who stared into my soul at my coffee shop. Even though he scares me, I feel a connection to Blu York. One I want to deepen.</p> <p>Blu and June meet under less than ideal circumstances. Can their love prevail? Or will dating a psychopath be too much for June?</p> <p>Blu, My Protector <i>is a MM dark themed, dual POV, high heat romance. It contains a cute barista and a psychopathic psychiatrist who will kill anyone who tries to hurt his little fox. HEA guaranteed. For mature listeners.</i></p>"; 
